import React from 'react';
import { Canvas } from 'react-three-fiber';

import './app.css'
import Box from './components/Box';

export default function App() {
  return (
    <div>
      <div id='canvas-wrapper'>
        <Canvas>
          <ambientLight intensity={0.5} />
          <Box />
        </Canvas>

      </div>
    </div>
  )
}
